import { Table, TableCell, TableHead, TableRow } from "@material-ui/core";
import react from "react";
import { useDispatch, useSelector } from "react-redux";
import tableDataReducer from "../Store/tableDataReducer";
import { tableDataLoadStart } from "./action";
import homePageStyles from "./styles";
const HomePage = () => {
  const classes = homePageStyles();
  const dispatch = useDispatch();
  react.useEffect(() => {
    dispatch(tableDataLoadStart());
  }, []);
  const storeState = useSelector((state) => {
    return state.tableDataReducer;
  });
  const { data } = storeState.data;
  return data ? (
    <div className={classes.root}>
      <Table>
        <TableHead>
          <TableRow>
            {Object.keys(data[0]).map((key) => {
              return <TableCell>{key}</TableCell>;
            })}
          </TableRow>
        </TableHead>
      </Table>
    </div>
  ) : (
    <h1>Nothing</h1>
  );
};
export default HomePage;
